import React from 'react'
import styled from 'styled-components';

const Style = styled.div`

	display: flexbox;
	flex-direction: row;
	justify-content: center;

`;

function Flexbox(props) {
	return(
		<Style>{props.children}</Style>
		)
}

export default Flexbox;
